import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import PrivacyPolicy from '../components/PrivacyPolicy';
import Subscription from '../components/subscription';
import SocialMedia from '../components/SocialMedia';
import TermsOfService from '../components/termsOfservice';
import './Footer.css';

const Footer = () => {
  const [activeContent, setActiveContent] = useState('terms'); // Default active content

  const handleContentChange = (content) => {
    setActiveContent(content);
  };

  return (
    <footer className="footer">
      <div className="footer-section">
        <h4>Pages</h4>
        <ul>
          <li onClick={() => handleContentChange('privacy')}>
            <Link to="#">Privacy Policy</Link>
          </li>
          <li onClick={() => handleContentChange('subscription')}>
            <Link to="#">Subscription</Link>
          </li>
          <li onClick={() => handleContentChange('terms')}>
            <Link to="#">Terms of Service</Link>
          </li>
        </ul>
      </div>

      <div className="footer-section">
        <h4>Social Media</h4>
        <SocialMedia />
      </div>

      <div className="footer-section">
        <div className="content-display">
          {activeContent === 'privacy' && <PrivacyPolicy />}
          {activeContent === 'subscription' && <Subscription />}
          {activeContent === 'terms' && <TermsOfService />}
        </div>
      </div>
    </footer>
  );
};

export default Footer;
